export default function contact() {
  return (
    <div>
        <h1><span id='span'>04.</span> What's Next?</h1>
        <div>
            <h1>Get In Touch</h1>

            <button className=' p-4 rounded-xl  border-2 hover:scale-105 ease-in-out duration-200 border-[#61dafb] text-[white] hover:bg-[#61dafb7c]'>Say Hello</button>

        </div>
    </div>
  )
}
